import {Button, Container, Row, Col, Alert, Breadcrumb} from 'react-bootstrap'
import { Route, Switch, Redirect, NavLink } from 'react-router-dom';

function App() {
  return (

    <div style={{flex: 1, backgroundColor: 'blue'}}>
      <Container>
        <header style={{height: '100vh'}} className="App-header">
          <img src={logo} style={{flex: 1 }}className="App-logo" alt="logo" />

          <div style={{
            justifyContent: 'center'
          }}
          className='Test'
            >
            <p style={{textAlign: 'center', backgroundColor: 'blue' }}> 
              This is a test
